import React from "react";
import { Container } from "react-bootstrap";

const Contact = () => {
  return (
    <section id="contact-and-support">
      <Container className="services-section mt-5 pt-5">
        <h1>Contact Us</h1>
      </Container>
    </section>
  );
};

export default Contact;
